    const params ={
      pagination: {
        el: '.swiper-pagination',
        type: 'bullets',
        clickable: true
      }
    }
    return (
      <div className={css(styles.wrapper)}>
        <Swiper {...params}>
            <img src={this.props.car} alt=""/>
            <img src={this.props.car} alt=""/>
